import React, { useEffect, useState } from "react";
import Papa from "papaparse";

export default function NatureCulturePage() {
  const [places, setPlaces] = useState([]);
  const [selectedPlace, setSelectedPlace] = useState(null);

  useEffect(() => {
    fetch("/data/spots.csv")
      .then((res) => res.text())
      .then((csv) => {
        Papa.parse(csv, {
          header: true,
          skipEmptyLines: true,
          complete: (res) => {
            // Filter by tags containing 'nature' or 'culture'
            const rows = res.data
              .filter((r) => r.name && r.tags)
              .filter((r) =>
                r.tags.toLowerCase().includes("nature") ||
                r.tags.toLowerCase().includes("culture")
              )
              .map((r) => ({ ...r, image: r.image || null }));
            setPlaces(rows);
          },
        });
      });
  }, []);

  return (
    <div style={{ padding: "24px" }}>
      {selectedPlace ? (
        <div
          style={{
            maxWidth: "800px",
            margin: "0 auto",
            background: "#fff",
            borderRadius: "16px",
            boxShadow: "0 4px 12px rgba(0,0,0,0.15)",
            padding: "24px",
          }}
        >
          {selectedPlace.image ? (
            <img
              src={selectedPlace.image}
              alt={selectedPlace.name}
              style={{
                width: "100%",
                height: "320px",
                objectFit: "cover",
                borderRadius: "12px",
                marginBottom: "16px",
              }}
            />
          ) : (
            <div
              style={{
                width: "100%",
                height: "320px",
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                background: "#eee",
                color: "#666",
                marginBottom: "16px",
                borderRadius: "12px",
              }}
            >
              No image
            </div>
          )}
          <h2 style={{ fontSize: "2rem", marginBottom: "12px" }}>
            {selectedPlace.name}
          </h2>
          <p style={{ marginBottom: "8px", fontWeight: "bold" }}>
            Tags: {selectedPlace.tags}
          </p>
          <p style={{ marginBottom: "16px" }}>{selectedPlace.description}</p>
          {/* Add extra details here */}
          <p>
            Opening Hours: {selectedPlace.opening || "Not available"} <br />
            Contact: {selectedPlace.contact || "Not available"}
          </p>
          <button
            onClick={() => setSelectedPlace(null)}
            style={{
              marginTop: "16px",
              padding: "10px 20px",
              background: "#007BFF",
              color: "#fff",
              border: "none",
              borderRadius: "8px",
              cursor: "pointer",
            }}
          >
            Back
          </button>
        </div>
      ) : (
        <div
          style={{
            display: "grid",
            gridTemplateColumns: "repeat(3, 1fr)",
            gap: "16px",
          }}
        >
          {places.map((p, i) => (
            <div
              key={i}
              onClick={() => setSelectedPlace(p)}
              style={{
                cursor: "pointer",
                border: "1px solid #ddd",
                borderRadius: "16px",
                overflow: "hidden",
                background: "#fff",
                boxShadow: "0 2px 6px rgba(0,0,0,0.1)",
                transition: "box-shadow 0.2s",
              }}
            >
              {p.image ? (
                <img
                  src={p.image}
                  alt={p.name}
                  style={{
                    height: "180px",
                    width: "100%",
                    objectFit: "cover",
                  }}
                />
              ) : (
                <div
                  style={{
                    height: "180px",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    background: "#eee",
                    color: "#666",
                  }}
                >
                  No image
                </div>
              )}
              <div style={{ padding: "12px" }}>
                <h3 style={{ fontWeight: "bold", marginBottom: "4px" }}>
                  {p.name}
                </h3>
                <p style={{ fontSize: "0.9rem", color: "#888" }}>{p.tags}</p>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}
